  .swiper-container {
    width: 100%;
    height: 40px;
  }

  .swiper-prev, .swiper-next {
    width: 42px;
    height: 42px;
    outline: none;
    border: 2px solid #fff;
    border-radius: 50%;
    color: #fff;
    position: absolute;
    top: 0;
    bottom: 0;
    margin: auto;
    opacity: .3;
    cursor: pointer;
    display: flex;
    justify-content: center;
    align-items: center;
    transition: .4s;
  }

  .swiper-prev {
    left: -100px;
  }

  .swiper-next {
    right: -100px;
  }

  .swiper-prev:hover, .swiper-next:hover {
    background-color: #fff;
    color: #333;
  }
}

#to-top {
  position: fixed;
  bottom: 30px;
  right: 30px;
  z-index: 9;
  width: 42px;
  height: 42px;
  background-color: #333;
  color: #fff;
  border: 2px solid #fff;
  border-radius: 10px;
  cursor: pointer;
  display: flex;
  justify-content: center;
  align-items: center;
}
